class Solution(object):
    def divideArray(self, nums):
            """
            :type nums: List[int]
            :rtype: bool
            """
            #edge case
            if not nums:
                return True
            #define variables
            n = len(nums)
            #sort nums
            nums = sorted(nums)
            #divide array into two parts
            a, b = 0, n-1
            #divide by 2 elements
            while a < b:
                #if a element not equal to b elements then return False
                if nums[a] != nums[b]:
                    return False
                #if a element equal to b elements then move forward
                a+=1
                b-=1
            #if a element equal to b elements then return True
            return True
    
